const profileReducer = (state = initialState, action) => {
  let stateCopy = { ...state };
  switch (action.type) {
    case ADD_POST:
      let newPost = {
        id: 123,
        count: 0,
        message: state.new_post_text,
        image:
          "data:image/jpeg;base64,"
      };
      stateCopy.post_data = [...state.post_data, newPost];
      stateCopy.new_post_text = "";
      return stateCopy;

    case UPDATE_NEW_TEXT_POST:
      stateCopy.new_post_text = action.changePostText;
      return stateCopy;

    default:
      return stateCopy;
  }
};

export const addPostActionCreater = () => ({
  type: ADD_POST
});
export const onPostChangeActionCreator = (text) => ({
  type: UPDATE_NEW_TEXT_POST,
  changePostText: text
});

export default profileReducer;
